              Math.random() * 256
            )}, ${Math.floor(Math.random() * 256)})`,
          }}
        ></div>
      ))}

      {/* {Array.from(Array(365).keys()).map((i) => (
        <p>o</p>
      ))} */}
    </div>
  );
}

